void dfs(int node, unordered_map<int, vector<int>> &adj, vector<int> &vis, vector<int> &blocked, int &ans) {
        
        vis[node] = 1;
        ans++;
        
        for(auto &ch : adj[node]) {
            
            if(blocked[ch] == 1) {
                vis[ch] = 1;
                continue;
            }   
            
            if(vis[ch] == 0) {
                dfs(ch, adj, vis, blocked, ans);
            }
        }
        
        return;
    }

