void dfsGraph(int node, unordered_map<int, vector<int>> &adj, vector<int> &dist, vector<int> &vis, int &maxi, int d) {
        
        vis[node] = 1;
        dist[node] = d;
        
        for(auto &ch : adj[node]) {
            
            if(vis[ch] == 0) {
                
                dist[ch] = dist[node] + 1;
                maxi = max(maxi, dist[ch]);
                
                dfsGraph(ch, adj, dist, vis, maxi, d + 1);
            }
        }

        return;
    }

